import React from 'react';

import './Panel.scss';

import TasksList from '../TasksList/TasksList';

interface Props {
    panelName: string;
}

const Panel = (props: Props) => {
    return (
        <div className="panel">
            <div>{props.panelName}</div>
            <TasksList 
                listTitle="TODO"
                listQuantity={43}
            />
            <TasksList 
                listTitle="IN PROGRESS"
                listQuantity={10}
            />
            <TasksList 
                listTitle="DONE"
                listQuantity={50}
            />
        </div>
    );
}

export default Panel;
